import React from 'react'
import "./Join.css";
import logo from "../Image/logo.jpg"

const Join = () => {
  return (
    <div className="JoinPage">
        <div className='JoinContainer'>
            <img src={logo} alt='Logo' ></img>
            <h1>Join Page </h1>
            <input type="text" id="JoinInput"></input>
            <button className="JoinBtn">Login</button>
        </div>

    </div>
  )
}

export default Join
